import React from "react";
import styles from './botao_inscricao.module.css';
import  './botao_inscricao.module.css';

function botaoInscricao(){
    return(
    <div className="botao">
            <button className={styles.botaoInscrever}>
                Inscreva-se
            </button>
        </div>
    )

}

export default botaoInscricao;
